import React from 'react';
import Modal from 'react-modal';

const OptionalModal=(props)=>{
    return (
     <Modal
     isOpen={false}
     contentLabel='Selected Option'
     >
         <h3>Selected Option</h3>

     </Modal>
    )
}
export default OptionalModal;
